import React from "react";
import "./testimonial.css";
const Testimonials = () => {
    return (
      <section className="testimonials-container">
        <h2>What Our Fans Are Saying</h2>
        <div className="testimonials">
          <div className="testimonial">
            <h3>"In processing"</h3>
            <p>
              My pug Sir Biscuit is obsessed with the Salmon Snackers! He does a little dance when he hears the
              Barkin' Baxter's truck coming. <span className="testimonal-author">Lily R.</span>
            </p>
          </div>
          <div className="testimonial">
            <h3>"In processing"</h3>
            <p>
              Baxters are at the top of the food chain! Maximus is a picky eater but he loves these treats.{' '}
              <span className="testimonal-author">Albert Z.</span>
            </p>
          </div>
          <div className="testimonial">
            <h3>"In processing"</h3>
            <p>
              Our little Mabel gives them two paws up and a whole lot of slobbery kisses.{' '}
              <span className="testimonal-author">Jennifer T.</span>
            </p>
          </div>
        </div>
      </section>
    );
  };

  export default Testimonials;
